export default class LocalJson extends Component {
    render(){
        return (
            <div className="results-container">
                {_jsonData.map( (data, i) =>
                    <ul>
                        <li key={i}>
                            {data.user}
                        </li>
                    </ul>
                )}
            </div>
        );
    }
}
